import { Card, Col } from "antd";

function CarsCard({ oneCar }) {
    return (
        <Col>
            <Card>oi
                <p>{oneCar.BRAND}</p>
                <p>{oneCar.MODEL}</p>
                <p>{oneCar.DEALER}</p>
                <p>{oneCar.MIN_MILEAGE}</p>
                <p>{oneCar.MAX_MILEAGE}</p>
            </Card>
        </Col>
    )
}

export default CarsCard;
